import React from "react";

export default function Card() {
  return (
    <div>
      <div className="container p-3 " style={{ height: "800px" }}>
        <div className="card rounded-5 h-100">
          <textarea
            className="form-control h-100 border-0"
            id="exampleFormControlTextarea1"
            rows="3"
          ></textarea>
        </div>
      </div>
    </div>
  );
}
